import { useEffect, useState } from "react";

interface Props {
  title: string;
  id: number;
  overview: string;
  backdrop_path: string;
}

function MoviePoster({ title, id, overview, backdrop_path }: Props) {
  const [image, setImage] = useState();

  useEffect(() => {
    getImage();
  });

  return (
    <div>
      {title}
      <p>{backdrop_path}</p>
    </div>
  );
}

export default MoviePoster;
